#Function
def convert_time_to_int(time_obj):
    hours = time_obj.hour
    minutes = time_obj.minute
    hours_str = str(hours).lstrip('0')
    minutes_str = str(minutes).lstrip('0')
    if hours_str == '':
        hours_str = '0'
    if minutes_str == '':
        minutes_str = '0'
    return int(hours_str + minutes_str)

